  //····················································································································

  var mSheetTitle_property_selection : EBSelection <String?> {
    if let model = self.propval {
      switch (model.mSheetTitle_property_selection) {
      case .empty :
        return .empty
      case .multiple :
        return .multiple
      case .single (let v) :
        return .single (v)
      }
    }else{
      return .single (nil)
    }
  }

  //····················································································································

  final func addEBObserverOf_mSheetTitle (_ inObserver : EBEvent) {
